import React from "react";
import product from "../../data/product";
import './main.css'

export default prop => {

    const lass = product.map(products => {
        return (
            <table id="customers">
            <tr>
              <th>{products.id}</th>
              <th>{products.product}</th>
              <th>{products.price}</th>
              </tr>
              </table>

        );
    })

    return (
        <div>
            {lass}
        </div>
    )
}
